import React from "react";
import { NavLink } from "react-router-dom";
import styles from "./NavBar.module.css";

const FormBar = () => {
  return (
    <div>
      <div className={styles.navbar}>
        <nav>
          <ul>
            <li>
              <NavLink
                to="/page-one"
                className={(navData) => (navData.isActive ? styles.active : "")}
              >
                Home
              </NavLink>
            </li>
            <li>
              <NavLink
                to="/page-two"
                className={(navData) => (navData.isActive ? styles.active : "")}
              >
                Empty
              </NavLink>
            </li>
          </ul>
        </nav>
      </div>
    </div>
  );
};

export default FormBar;
